import React, { useState } from 'react';

const ProductManagement = ({ products, setProducts }) => {
    const [formData, setFormData] = useState({ id: null, name: '', category: '', quantity: 0, price: 0 });

    const handleSubmit = (e) => {
        e.preventDefault();
        if (formData.id !== null) {
            const updatedProducts = products.map((product) =>
                product.id === formData.id ? formData : product
            );
            setProducts(updatedProducts);
        } else {
            setProducts([...products, { ...formData, id: Date.now() }]);
        }
        setFormData({ id: null, name: '', category: '', quantity: 0, price: 0 });
    };

    const handleDelete = (id) => {
        setProducts(products.filter((product) => product.id !== id));
    };

    return (
        <div style={styles.container}>
            <h2 style={styles.heading}>Product Management</h2>
            <form onSubmit={handleSubmit} style={styles.form}>
                <input
                    type="text"
                    placeholder="Name"
                    value={formData.name}
                    onChange={(e) => setFormData({ ...formData, name: e.target.value })}
                    required
                    style={styles.input}
                />
                <input
                    type="text"
                    placeholder="Category"
                    value={formData.category}
                    onChange={(e) => setFormData({ ...formData, category: e.target.value })}
                    required
                    style={styles.input}
                />
                <input
                    type="number"
                    placeholder="Quantity"
                    value={formData.quantity}
                    onChange={(e) => setFormData({ ...formData, quantity: parseInt(e.target.value) || 0 })}
                    required
                    style={styles.input}
                />
                <input
                    type="number"
                    placeholder="Price"
                    value={formData.price}
                    onChange={(e) => setFormData({ ...formData, price: parseFloat(e.target.value) || 0 })}
                    required
                    style={styles.input}
                />
                <button type="submit" style={styles.button}>
                    {formData.id ? 'Update' : 'Add'} Product
                </button>
            </form>

            <ul style={styles.list}>
                {products.map((product) => (
                    <li key={product.id} style={styles.listItem}>
                        <span>{product.name} - {product.category} - {product.quantity} in stock</span>
                        <button onClick={() => setFormData(product)} style={styles.editButton}>Edit</button>
                        <button onClick={() => handleDelete(product.id)} style={styles.deleteButton}>Delete</button>
                    </li>
                ))}
            </ul>
        </div>
    );
};

const styles = {
    container: {
        maxWidth: '600px',
        margin: '2rem auto',
        padding: '2rem',
        backgroundColor: '#f5f5f5',
        borderRadius: '8px',
        boxShadow: '0px 4px 8px rgba(0, 0, 0, 0.1)',
        textAlign: 'center',
        fontFamily: 'Arial, sans-serif',
    },
    heading: {
        color: '#333',
        fontSize: '1.8rem',
        marginBottom: '1.5rem',
    },
    form: {
        display: 'flex',
        flexDirection: 'column',
        gap: '1rem',
        marginBottom: '1.5rem',
    },
    input: {
        padding: '0.8rem',
        fontSize: '1rem',
        border: '1px solid #ddd',
        borderRadius: '4px',
        transition: 'border-color 0.2s',
    },
    button: {
        padding: '0.8rem',
        fontSize: '1rem',
        color: '#fff',
        backgroundColor: '#2193b0',
        border: 'none',
        borderRadius: '4px',
        cursor: 'pointer',
        transition: 'background-color 0.3s',
    },
    list: {
        listStyleType: 'none',
        padding: 0,
        margin: 0,
    },
    listItem: {
        padding: '1rem',
        margin: '0.5rem 0',
        backgroundColor: '#fff',
        borderRadius: '4px',
        boxShadow: '0px 2px 4px rgba(0, 0, 0, 0.1)',
        display: 'flex',
        justifyContent: 'space-between',
        alignItems: 'center',
    },
    editButton: {
        padding: '0.5rem',
        fontSize: '0.9rem',
        color: '#fff',
        backgroundColor: '#ffb74d',
        border: 'none',
        borderRadius: '4px',
        cursor: 'pointer',
        transition: 'background-color 0.3s',
        marginLeft: '0.5rem',
    },
    deleteButton: {
        padding: '0.5rem',
        fontSize: '0.9rem',
        color: '#fff',
        backgroundColor: '#f44336',
        border: 'none',
        borderRadius: '4px',
        cursor: 'pointer',
        transition: 'background-color 0.3s',
        marginLeft: '0.5rem',
    },
};

export default ProductManagement;
